import React from "react";
import DeleteIcon from "@material-ui/core/Delete"; 

const ListCom = (props)=>{
	return(
<div className="todo_style">
<span>
<DeleteIcon />
</span>
<li> {props.text} </li>
</div>
);
};

export default ListCom;
